import React, { useState } from 'react';

function Home() {
    const [formData, setFormData] = useState({
        oncampus: '',
        withfriends: '',
        alone: '',
        selfmade: ''
    });

    const [showResults, setShowResults] = useState(false);
    const [loading, setLoading] = useState(false);
    const [results, setResults] = useState({
        socialScore: 0,
        independenceScore: 0,
        campusScore: 0,
        totalMeals: 0
    });

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData(prev => ({
            ...prev,
            [name]: value
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();

        const oncampus = parseInt(formData.oncampus) || 0;
        const withfriends = parseInt(formData.withfriends) || 0;
        const alone = parseInt(formData.alone) || 0;
        const selfmade = parseInt(formData.selfmade) || 0;

        setShowResults(true);
        setLoading(true);

        setTimeout(() => {
            const totalMeals = oncampus + withfriends + alone + selfmade;
            const socialScore = Math.round(((withfriends + oncampus) / Math.max(totalMeals, 1)) * 100);
            const independenceScore = Math.round((selfmade / Math.max(totalMeals, 1)) * 100);
            const campusScore = Math.round((oncampus / Math.max(totalMeals, 1)) * 100);

            setResults({
                socialScore,
                independenceScore,
                campusScore,
                totalMeals
            });

            setLoading(false);
        }, 1500);
    };

    return (
        <div className="container mx-auto px-4 py-8 max-w-2xl">
            <div className="bg-white rounded-lg shadow-lg p-8">
                <form onSubmit={handleSubmit} className="space-y-6">
                    <div className="space-y-4">
                        <div>
                            <label htmlFor="oncampus" className="block text-sm font-medium text-gray-700">
                                Eat at an on-campus eatery (Food trucks, restaurants, food court)
                            </label>
                            <input
                                type="number"
                                id="oncampus"
                                name="oncampus"
                                value={formData.oncampus}
                                onChange={handleInputChange}
                                placeholder="Times per week"
                                min="0"
                                max="21"
                                className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-sdsu-red focus:ring-sdsu-red"
                            />
                        </div>

                        <div>
                            <label htmlFor="withfriends" className="block text-sm font-medium text-gray-700">
                                Eat with friends
                            </label>
                            <input
                                type="number"
                                id="withfriends"
                                name="withfriends"
                                value={formData.withfriends}
                                onChange={handleInputChange}
                                placeholder="Times per week"
                                min="0"
                                max="21"
                                className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-sdsu-red focus:ring-sdsu-red"
                            />
                        </div>

                        <div>
                            <label htmlFor="alone" className="block text-sm font-medium text-gray-700">
                                Eat alone
                            </label>
                            <input
                                type="number"
                                id="alone"
                                name="alone"
                                value={formData.alone}
                                onChange={handleInputChange}
                                placeholder="Times per week"
                                min="0"
                                max="21"
                                className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-sdsu-red focus:ring-sdsu-red"
                            />
                        </div>

                        <div>
                            <label htmlFor="selfmade" className="block text-sm font-medium text-gray-700">
                                Prepared a meal on my own
                            </label>
                            <input
                                type="number"
                                id="selfmade"
                                name="selfmade"
                                value={formData.selfmade}
                                onChange={handleInputChange}
                                placeholder="Times per week"
                                min="0"
                                max="21"
                                className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-sdsu-red focus:ring-sdsu-red"
                            />
                        </div>
                    </div>

                    <button
                        type="submit"
                        className="w-full bg-sdsu-red text-white py-3 px-4 rounded-md hover:bg-red-800 transition-colors font-medium"
                    >
                        Analyze Nutritional Patterns
                    </button>
                </form>

                {showResults && (
                    <div className="mt-8 border-t pt-6">
                        <h3 className="text-lg font-semibold text-gray-900 mb-4">
                            ðŸ“Š Nutritional Health Analysis
                        </h3>
                        {loading ? (
                            <div className="text-center text-sdsu-red italic">
                                Processing nutritional data...
                            </div>
                        ) : (
                            <div className="space-y-4">
                                <div className="flex justify-between items-center p-3 bg-gray-50 rounded-lg">
                                    <span className="font-medium text-gray-700">Social Dining Score</span>
                                    <span className="bg-sdsu-red text-white px-3 py-1 rounded-full">
                                        {results.socialScore}%
                                    </span>
                                </div>
                                <div className="flex justify-between items-center p-3 bg-gray-50 rounded-lg">
                                    <span className="font-medium text-gray-700">Independence Index</span>
                                    <span className="bg-sdsu-red text-white px-3 py-1 rounded-full">
                                        {results.independenceScore}%
                                    </span>
                                </div>
                                <div className="flex justify-between items-center p-3 bg-gray-50 rounded-lg">
                                    <span className="font-medium text-gray-700">Campus Engagement</span>
                                    <span className="bg-sdsu-red text-white px-3 py-1 rounded-full">
                                        {results.campusScore}%
                                    </span>
                                </div>
                                <div className="flex justify-between items-center p-3 bg-gray-50 rounded-lg">
                                    <span className="font-medium text-gray-700">Weekly Meals Total</span>
                                    <span className="bg-sdsu-red text-white px-3 py-1 rounded-full">
                                        {results.totalMeals}
                                    </span>
                                </div>
                            </div>
                        )}
                    </div>
                )}
            </div>
        </div>
    );
}

export default Home;
